import { StyleSheet } from 'react-native';
import { colors, fonts } from '../../Styles';

const styles = StyleSheet.create({
  content: {
    flex: 1,
    paddingHorizontal: 5
  },

  text: {
    color: colors.light,
    marginTop: 40,
    marginBottom: 10
  }
});

export default styles;
